let quote2 = 0;
let wpm = 0;
let wps = 0;
let time = 60;
let start = false;
let done = false;

//generate first word
r = Math.floor(Math.random() * words.length);

//keyboard events
i.addEventListener("keydown",(event) => {
    start = true;
    if(done == false){
    //generate new word
    if(event.key == "Enter"){

        txt = document.getElementById("input").value;

        if(txt == words[r]){
            c_c+=1;
        } 
        else{
            c+=1;
        }
        count++;
        input = document.getElementById("input").value;
        r+=1;
        document.getElementById("input").value = ""
    }
    }
})

//updatecount
setInterval(function update(){ 
    //calculate quote
    if(c < 1){
        quote = c_c/1;
    }
    else{
        quote = c_c/c;
    }

    if(count < 1){
        quote2 = c_c/1;
    }
    else{
        quote2 = c_c/count;
    }

    document.getElementById("count").innerHTML = "wrong words: " + c;
    document.getElementById("correct").innerHTML = "correct words: " + c_c;
    document.getElementById("quote").innerHTML = "quote: " + quote;
    document.getElementById("wpm").innerHTML = "WPM: " +wpm;
    document.getElementById("wps").innerHTML = "WPS: " +wps;
    document.getElementById("text").innerHTML = words[r];
    document.getElementById("text1").innerHTML = words[r+1];
    document.getElementById("text2").innerHTML = words[r+2];
    document.getElementById("quote2").innerHTML = "quote: " + Math.round(quote2*100)+"%";

},1)

setInterval(function t(){
    if(start == true){
        setTimeout(function timer(){
            if(time > 0){
                time-=1;
            }
            else{
                wpm = count;
                wps = wpm/60;

                done = true;
            }
            document.getElementById("timer").innerHTML = "time left: " + time;
        },1000)
    }
},1000)